import axios from './index'
import el from "element-ui/src/locale/lang/el";

export const getCeShi = ({userId}) => {
    return axios.request({
        url: '/member-manage/businessMember/get',
        method: "get",
        data: {
            userId: userId
        }
    })
}




// 地图文章地理分布
